import React from "react";
import Aside from "../components/Aside";
import { categorias } from "../data/categorias";

function Categorias() {
  return (
    <Aside>
      {categorias?.map((e) => {
        return <h2>{e.name}</h2>;
      })}
    </Aside>
  );
}

export default Categorias;
